import React from 'react';
import { FaTwitter, FaGithub } from 'react-icons/fa';

// Footerコンポーネントを定義
function Footer() {
  return (
    <footer style={styles.footer}>
      <div style={styles.container}>
        <div style={styles.links}>
          <a href="https://twitter.com" style={styles.link}>お問い合わせ</a>
          <a href="/terms" style={styles.link}>利用規約</a>
          <a href="/privacy" style={styles.link}>プライバシーポリシー</a>
        </div>
        <div style={styles.icons}>
          <a href="https://twitter.com" style={styles.iconLink}>
            <FaTwitter style={styles.icon} />
          </a>
          <a href="https://github.com" style={styles.iconLink}>
            <FaGithub style={styles.icon} />
          </a>
        </div>
        <div style={styles.copy}>
          &copy; 2025 - ver.1.00
        </div>
      </div>
    </footer>
  );
}

// スタイルオブジェクトを定義
const styles = {
  footer: {
    backgroundColor: '#5D9CEC',
    color: 'white',
    padding: '20px 0',
    position: 'fixed',
    bottom: 0,
    width: '100%',
    display: 'flex',
    justifyContent: 'center',
  },
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    width: '100%',
  },
  links: {
    marginBottom: '10px',
    display: 'flex',
    justifyContent: 'center',
  },
  link: {
    color: 'white',
    margin: '0 15px',
    textDecoration: 'none',
  },
  icons: {
    marginBottom: '10px',
    display: 'flex',
    justifyContent: 'center',
  },
  iconLink: {
    margin: '0 10px',
  },
  icon: {
    color: 'white',
    fontSize: '20px',
  },
  copy: {
    fontSize: '14px',
  },
};

// Footerコンポーネントをエクスポート
export default Footer;
